import React from 'react';
import PropTypes from 'prop-types';
import Drawer from '../../shared/Drawer/Drawer';
import { DRAWER_SIDE } from '../../../config/constants';

const EditCard = props => {
    const { isCollapsedCard, setIsCollapsedCard, ...editCard } = props;

    return (
        <Drawer
            side={DRAWER_SIDE.right}
            isCollapsed={isCollapsedCard}
            setIsCollapsed={setIsCollapsedCard}
            className={'bg-white'}
            {...editCard}
        >
            Configurations
        </Drawer>
    );
};

EditCard.propTypes = {};

export default EditCard;
